import React, { Component } from 'react'
import Title from './Title'
import {FaCoktail, FaHiking, FaShuttleVan, FaBeer } from "react-icons/fa"

export default class Services extends Component {
  state={
      services: [
          {
              icon:<FaCoktail/>,
              title:"free coktails",
          }
      ]
  }
  render() {
    return (
      <div>
          <Title title='Services' />
          loren10
      </div>
    )
  }
}
